import React, { Component } from 'react';
import { NavLink, withRouter } from 'react-router-dom';

class Arrival extends Component {
  render() {
    return (
      <div>
        <form className='ui form'>
          <h4>Arrival Component</h4>
        </form>
      </div>
    )
  }
}

export default withRouter(Arrival);
